"""
Given a matrix and a target, return the number of non-empty sub matrices that sum to target.

A sub matrix x1, y1, x2, y2 is the set of all cells matrix[x][y] with x1 <= x <= x2 and y1 <= y <= y2.

Two sub matrices (x1, y1, x2, y2) and (x1', y1', x2', y2') are different if they have some coordinate that is different:
 for example, if x1 != x1'.
"""
from typing import List


def num_sub_matrix_sum_target_precompute(matrix: List[List[int]], target: int) -> int:
    """
    :param matrix: matrix of integers values, such that 1 <= matrix.length <= 100 and 1 <= matrix[0].length <= 100
    :param target: -10**8 <= target <= 10**8
    :return: will destruct matrix, return number of sub matrix within matrix that sum to target
    """
    # Convert matrix into cumulative sum
    # i.e. row[i][j] = sum(old_matrix[i][:j+1]), self included
    m, n = len(matrix), len(matrix[0])
    for row in matrix:
        for i in range(1, n):
            row[i] += row[i - 1]

    return_val = 0
    for col_1 in range(n):
        for col_2 in range(col_1, n):
            # use cumulative sum methods to count sub matrix count that bounded between col_1 and col_2
            sum_counter = {0: 1}
            accumulator = 0
            for row_i in range(m):
                accumulator += matrix[row_i][col_2] - (matrix[row_i][col_1 - 1] if col_1 else 0)
                return_val += sum_counter.get(accumulator - target, 0)
                sum_counter[accumulator] = sum_counter.get(accumulator, 0) + 1

    return return_val


def num_sub_matrix_sum_target_on_the_fly(matrix: List[List[int]], target: int) -> int:
    """
    :param matrix: matrix of integers values, such that 1 <= matrix.length <= 100 and 1 <= matrix[0].length <= 100
    :param target: -10**8 <= target <= 10**8
    :return: will not destruct matrix, return number of sub matrix within matrix that sum to target
    """
    # Convert matrix into cumulative sum
    # i.e. row[i][j] = sum(old_matrix[i][:j+1]), self included
    m, n = len(matrix), len(matrix[0])

    return_val = 0
    for row_1 in range(m):
        cumulative_sum = [0] * n  # cumulative sum for sub matrix with upper bound on row_1
        for row_2 in range(row_1, m):
            for col, val in enumerate(matrix[row_2]):
                cumulative_sum[col] += val
            # use cumulative sum methods to count sub matrix count that bounded between col_1 and col_2
            sum_counter = {0: 1}
            accumulator = 0
            for col_cumulative_sum in cumulative_sum:
                accumulator += col_cumulative_sum
                return_val += sum_counter.get(accumulator - target, 0)
                sum_counter[accumulator] = sum_counter.get(accumulator, 0) + 1

    return return_val


